import React, { Component } from 'react';
// import axios from 'axios';
import './home.css'
import health from '../health.jpg'
class Home extends Component {


    render() {
        return (
            <div >
              <img src="health.jpg" alt="health image" height="500px" width="500"></img>
            </div>      
        )
    }
}

export default Home;
